import React from 'react';
import './App.css';
import Header from './Header';
import Body from './Body';
import Footer from './Footer';

class App extends React.Component{
  render(){
    return (
      < div className = "App App-header" >
        <Header />
        <Body />
        <Footer />
      </div>
    );
  }
}

export default App;
